const checkStrength = (password, obj) => {
  const numTrue = Object.values(obj).reduce((numTrue, value) => {
    if (value === true) numTrue += 1;
    return numTrue;
  }, 0);
  if (password.length === 0) return "none";
  else if (password.length <= 4 && numTrue >= 1) return "too weak";
  else if (password.length <= 8 && numTrue >= 2) return "weak";
  else if (password.length <= 12 && numTrue >= 3) return "medium";
  else if (password.length >= 12 && numTrue === 4) return "strong";
};

export default checkStrength;
